css:
/*
* This is sortof prepared for adjustable themes.
* Everything is based of a single color taken from the syntax theme.
*/
.select-list.linter-list.popover-list {
  font-family: 'Helvetica Neue', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 12px;
  width: auto;
}
.select-list.linter-list.popover-list .list-group li:not(.list-nested-item) {
  padding-left: 0;
  line-height: 18px;
}
.select-list.linter-list.popover-list .linter-name {
  margin-right: 5px;
}
